import React, { useEffect } from "react";
import NavBar from "./NavBar";

const ApiKey = "b10f26ad1365b480abc56ae5b5d98080";
function Browse() {
  const requests = {
    fetchTrending: `https://api.themoviedb.org/3/trending/all/week?api_key=${ApiKey}&language=en-US`,
    fetchNetflixOriginals: `https://api.themoviedb.org/3/discover/tv?api_key=${ApiKey}&with_network=123S`,
    fetchTopRated: ``,
  };

  const fetchTrending = async (requests) => {
    try {
      const response = await fetch(requests);
      if (!response.ok) {
        throw new Error("Fetch trending to failed");
      }
      const data = await response.json();
      console.log(data);
    } catch (error) {
      alert(error.message);
    }
  };

  // useEffect(() => {
  fetchTrending(requests.fetchNetflixOriginals);
  // }, [fetchTrending]);

  return (
    <div>
      <NavBar />
    </div>
  );
}

export default Browse;
